  return (
  <Container>
    <Grid container 
    style = {{height: window.innerHeight - 50}}
              alignItems = {'center'}
              justify = {'center'}
              border={'1px solid red'}
    >
         ssssssssssssssssssss   
    </Grid>
  </Container>);
}
